var orderlabel = {
	suite : '',
	order: '',
	initOrderLabel: function(){
		$('canvas.canvas_boxLabel').each(function(i,v){
			orderlabel.generateLabel(v,$(v).data('merchant'), $(v).data('id'));
		});
	},
	generateLabel: function(canvas, merchant, boxnumber){
		var ctx = canvas.getContext("2d");
		var orderLabelImg = new Image();
		var barcodeImg = new Image();
		var link = document.createElement('link');
		link.rel = 'stylesheet';
		link.type = 'text/css';
		link.href = 'https://fonts.googleapis.com/css?family=Open+Sans';
		document.getElementsByTagName('head')[0].appendChild(link);

		var image = new Image;
		image.src = link.href;
		orderLabelImg.onload = function(){
			ctx.drawImage(this, 0,0, canvas.width, canvas.height);
		};
		var barcode_size = 120;
		barcodeImg.onload = function(){
			ctx.drawImage(this, (canvas.width/2) - barcode_size / 2 ,(canvas.height/2) - barcode_size / 2, barcode_size, barcode_size);
		};
		orderLabelImg.src = "data:image/png;base64,";
		image.onerror = function() {
		    ctx.font = '700 18px "Open Sans"';
		    ctx.textBaseline = 'top';
		    ctx.fillText(merchant.toUpperCase(), 15, 40);
		    ctx.font = '700 22px "Open Sans"';
		    ctx.textBaseline = 'top';
		    ctx.textAlign = 'center';
		    ctx.fillText(orderlabel.order+'-'+orderlabel.suite+'-'+(boxnumber < 10 ? '0' : '') + boxnumber, canvas.width / 2, canvas.height - 60);
			barcodeImg.src = $('.barcode[data-id='+boxnumber+'] img').attr('src');
		};
	}
}